import React from 'react';
import Services from "./service/Services";
import {useMediaQuery} from "react-responsive";
import {RESPONSIVE} from "../../../responsive/Responsive";
import DropDownService from "./DropDownService";
import PriceDesktop from "./price/PriceDesktop";
import PricePhone from "./price/PricePhone";
import Service from "./service/Service";
import PriceDecide from "./price/PriceDecide";

function Calculation({handleChoices}) {
    const mobile = useMediaQuery(RESPONSIVE.MOBILE);

    const desktop = !mobile;
    const styleContainer = desktop ? "row" : "col alItCenter";
    const service = desktop ? <Services handleChoices={handleChoices}/> : <DropDownService/>

    return (
        <>
            <div className={styleContainer}>
                {service}
                <PriceDecide handleChoices={handleChoices}/>
            </div>
        </>

    );
}

export default Calculation;
